var limit = 30;
 //just do the first 25 tags, the browser slows down when the graphs too big
data = data.tags.slice(0,limit);
var graphData = {
    "nodes": [],
    "links": []
};;
var groups = [];

// Add a node to the final data set
var addNode = function(tag) {
    var group = tag.group_id;
    var node = {"name": tag.name};
    if (groups.indexOf(group) === -1) {
        node.group = groups.push(group);
    } else {
        node.group = groups.indexOf(group);
    }
    return node;
}

// a helper function to find similar objects
var findIndexOf = function(array, match) {
    for (var i = 0; i < array.length; i++) {
        for (key in match) {
            if (match[key] != array[i][key]) {
                break;
            }
            return i;
        }
    }
    return -1;
}

data.forEach(function(tag, index) {
    // simplify the data so that it only has the node name and group
    graphData.nodes.push(addNode(tag));
    
    // get the edges by querying related tags
    // Make an API call for each tag to get related tags
    // Only get first 5 related tags
    var url = "http://api.stlouisfed.org/fred/related_tags?tag_names=" +
        encodeURIComponent(tag.name) + 
        "&limit=" +
        limit + 
        "&api_key=" + 
        API_KEY + 
        "&file_type=json";

    request({
        url: url,
        json: true
    }, function (error, response, body) {
        if (!error && response.statusCode === 200) {
            var related = body.tags;
            // For each responded related tag, add a link
            related.forEach(function(relatedTag) {
                var target;
                var relatedIndex = findIndexOf(graphData.nodes, {"name": relatedTag.name});
                if (relatedIndex == -1) {
                    target = graphData.nodes.push(addNode(relatedTag)) - 1;
                } else {
                    target = relatedIndex;
                    // If a link already exists, increase the link's value by 1
                    var linkIndex = findIndexOf(graphData.links, {"source": index, "target": target});
                    if (linkIndex != -1) {
                        graphData.links[linkIndex].value++;
                        return;
                    }
                }
                // otherwise create a new link
                graphData.links.push({"source": index, "target": target, "value": 1});
            });
            if (index == data.length - 1) {
                fs.writeFile("tags_graph.json", JSON.stringify(graphData));
            }
            console.log("Indexing tag number " + index);
        }
    })
});